import React from "react";
import { Container, Button} from "reactstrap";
import Particles from 'react-particles-js'
function IndexHeader() {
  return (
    <>
      <div
        className="page-header section-dark"
        style={{
          backgroundImage:
            "url(" + require("assets/img/bastion.jpg") + ")",
        }}
      >
        <div className="filter" />
        <div className="content-center">
          <Container>
            <div className="title-brand">
              <h1 className="presentation-title">Imminent</h1>
              {/* <div className="fog-low">
                <img alt="..." src={require("assets/img/fog-low.png")} />
              </div> */}
            </div>
            <h2 className="presentation-subtitle text-center"> 
               H Trypa tou TSOSOUA den exei oria
            </h2>
            <br/>
            <br/>
            <br/> 
            <br/>
            <br/>

              <Button href="https://docs.google.com/forms/u/1/d/1tZQHYzSwy39Wpy9mbi66nchmWwi6pWrPSP_0lLjtMzw" target="_blank" className="btn btn-default btn-framed"> Apply Now</Button> 
              <Button style={{margin:"50px"}} href="https://www.wowprogress.com/guild/eu/twisting-nether/Imminent" target="_blank" className="btn btn-default btn-framed"> WoW Progress</Button> 
              <Button style={{margin:"50 0 0 0"}} href="https://raider.io/guilds/eu/twisting-nether/Imminent" target="_blank" className="btn btn-default btn-framed"> Raider IO</Button> 

          </Container>
        </div>     
        <Particles   style={{ position: "absolute",zIndex: -1 }}
  height="95%"
  width="95%"
   params={{
    "particles": {
      "number": {
          "value": 76,
          "density": {
              "enable": true,
              "value_area": 800
          }
      },
      "color": {
          "value": "#ffd700"
      },
      "shape": {
          "type": "circle",
          "stroke": {
              "width": 0,
              "color": "#000000"
          },
          "polygon": {
              "nb_sides": 5
          },
          "image": {
              "src": "img/github.svg",
              "width": 100,
              "height": 100
          }
      },
      "opacity": {
          "value": 0.5,
          "random": false,
          "anim": {
              "enable": false,
              "speed": 1,
              "opacity_min": 0.1,
              "sync": false
          }
      },
      "size": {
          "value": 3.9458004845442964,
          "random": true,
          "anim": {
              "enable": false,
              "speed": 40,
              "size_min": 0.1,
              "sync": false
          }
      },
      "line_linked": {
          "enable": false,
          "distance": 150,
          "color": "#ffffff",
          "opacity": 0.4,
          "width": 1
      },
      "move": {
          "enable": true,
          "speed": 1.666902811231592,
          "direction": "none",
          "random": true,
          "straight": false,
          "out_mode": "out",
          "bounce": false,
          "attract": {
              "enable": false,
              "rotateX": 600,
              "rotateY": 1200
          }
      }
  },
  "interactivity": {
      "detect_on": "canvas",
      "events": {
          "onhover": {
              "enable": false,
              "mode": "repulse"
          },
          "onclick": {
              "enable": false,
              "mode": "push"
          },
          "resize": true
      },
      "modes": {
          "grab": {
              "distance": 400,
              "line_linked": {
                  "opacity": 1
              }
          },
          "bubble": {
              "distance": 400,
              "size": 40,
              "duration": 2,
              "opacity": 8,
              "speed": 3
          },
          "repulse": {
              "distance": 200,
              "duration": 0.4
          },
          "push": {
              "particles_nb": 4
          },
          "remove": {
              "particles_nb": 2
          }
      }
  },
  "retina_detect": true
}}/>
      </div>
    </>
  );
}

export default IndexHeader;
